import Footer from "./components/Footer";
import Header from "./components/Header";
import IconSide from "./components/IconSide";
import Routes from "./routes";
import { GlobalStyle } from "./styles/GlobalStyles";

function App() {
  return (
    <>      
      <header>
        <Header />
      </header>

      <aside>
        <IconSide />
      </aside>

      <main>
        <Routes />
      </main>

      <footer>
        <Footer />
      </footer>
      <GlobalStyle />
    </>
  );
}

export default App;
